import './Home.css';
import {Link} from 'react-router-dom';

function Home() {
  return (
    <>
      <div>
        <div>
         <Link to="/"><p className="logo" >lulu school</p></Link>
        </div>

        <div>
          <ul>
           <li class="nav-item">
            <button class="nav-link">КІРУ</button>
           </li>
           <li class="nav-item">
            <button class="nav-link">ҚАЗ</button>
           </li>
          </ul>
        </div>

      </div>
    </>
  );
}

export default Home;
